if mibBuilder.loadTexts: mscShelfCardSparingConnectionStatus.setStatus('mandatory')
if mibBuilder.loadTexts: mscShelfCardSparingConnectionStatus.setDescription('This attribute indicates if the control signal received from a 1forN sparing panel or a 1for1 sparing panel is properly terminated. notApplicable - The card is not provisioned as part of a sparing configuration, and is not connected to any sparing panel. 1for1Ok -The card is provisioned correctly for 1for1 sparing and is connected to the active relay of a 1for1 sparing panel. 1forNOk -The card is provisioned correctly for either 1for1 or 1forN sparing and is connected to either the standby or active relay of a 1forN sparing panel. unconfirmed -The card is provisioned as part of a sparing configuration, but its connection status cannot be determined. To determine if the card is connected to a sparing panel, perform a switchover of the LP to see if the card will grab a relay when it is active. If the card has grabbed the relay, the sparing connection status should change from, unconfirmed, to 1for1Ok and the LED on the sparing panel corresponfing to that relay should be illuminated. Please note: Performing the switchover will disrupt traffic on the other card and this test should be conducted when no traffic is running on the active card. notConnected - The card is provisioned as part of a sparing configuration, but is not connected to a sparing panel. Remedial Action: Check the cable connectivity between the card and the sparing panel. incorrectlyConnected - The card is provisioned as part of a sparing configuration, but is connected to the wrong port on a 1forN panel, or is connected to a 1for1 sparing panel while configured for 1forN. Remedial Action: Connect the cable to the port that was specified by the sparingConnection attribute. inconsistentlyConnected - The card is provisioned as part of a 1forN sparing configuration, but is connected to a sparing panel which is not the same as the other cards sharing the same spare card. Remedial Action: Ensure all cards that share the same spare card are connected to the same sparing panel. This value is also used to indicate that two sparing panels with the same sparing panel IDs are being used by cards on the same shelf. Remedial Action: Replace one of the sparing panels with another panel that has a different sparing panel ID. Sparing panel IDs are assigned at the time of manufacture and cannot be changed by the user.')
